import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import crown from '../imgs/crown.png'
import Typography from '@material-ui/core/Typography'
import Grid from '@material-ui/core/Grid';

const styles = {
    paper : {
        margin:5,
        padding:10
    },
    img : {
        width: 50
    }
}

class Achievments extends Component {
    render() {
        return (
            <div>
                <Paper style={styles.paper}>
                    <Grid container style={{margin: "auto"}}>
                        <Grid item md={12} style={{textAlign:"center", margin:"auto",padding:10}}>
                            <img src={crown} alt="crown" style={styles.img}/>
                            <Typography>Achievments</Typography>
                        </Grid>
                    </Grid>
                </Paper>
            </div>
        )
    }
}

export default Achievments
